import React from 'react';
import { Link } from 'react-router-dom';
import { HeaderArea } from './styled';

const Header = () => {
    let imageName = require('../img/logo_Regep.png');
    return (
        <HeaderArea>
            <div className="container">
                <div className="logo">
                    <Link to="/">
                        <img src={imageName} />
                    </Link>
                </div>
            </div>
        </HeaderArea>
    );
}

export default Header;
